import './App.css';
import InitialPage from './pages/InitialPage';
import { Route, Switch } from 'react-router';


function App() {
  return (
    <Switch>
      <Route exact path="/">
        <InitialPage />
      </Route>
    </Switch>
  );
}

export default App;
